-- ----------------------------
-- Triggers structure for table orderdetails
-- ----------------------------
DROP TRIGGER IF EXISTS `after_update_orderdetails`;
delimiter ;;
CREATE TRIGGER `after_update_orderdetails` AFTER UPDATE ON `orderdetails` FOR EACH ROW BEGIN 
		DECLARE temp DECIMAL(10,2);
		SET temp = totalCost(new.orderNumber);
		IF (new.orderNumber IN (SELECT Mahoadon FROM Khuyen_mai) AND temp > 6500) THEN
		UPDATE Khuyen_mai
		SET Sotien = temp*0.95
		WHERE Mahoadon = new.orderNumber;
		ELSEIF(temp>6500) THEN
		VALUES (new.orderNumber, temp*0.95);
		END IF;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
